import React from 'react';

const About = () => {
  return (
    <div className="about">
      <h1>About Us</h1>
      <p>Kami adalah perusahaan yang didedikasikan untuk menyediakan produk berkualitas tinggi kepada pelanggan kami.</p>
      <p>Misi kami adalah memberikan produk luar biasa yang memenuhi kebutuhan dan harapan pelanggan kami.</p>
      <p>Untuk informasi lebih lanjut, silakan hubungi kami di donatnikmat@gmail.com.</p>
    </div>
  );
};

export default About;
